import React from 'react';
import Logo from "../assets/Group.png";
import XLogo from "../assets/footer/x.svg";
import InstaLogo from "../assets/footer/instagram.svg";
import PintrestLogo from "../assets/footer/pintrest.svg";
import LinkedinLogo from "../assets/footer/linkedin.svg";
import TiktokLogo from "../assets/footer/tiktok.svg";
import YoutubeLogo from "../assets/footer/youtube.svg";

const Footer = () => {
  return (
    <footer className="flex justify-between w-full bg-gray-800 text-white px-4 py-8">
      {/* Left section */}
      <div className="flex flex-col justify-between w-2/5 ">
        <div className="flex flex-col gap-2">
          <img src={Logo} width={30} height={30} alt="Logo"/>
          <p className="font-inter text-xs text-neutral-400 ">Effortlessly turn your ideas into a fully functional, responsive, no-code SaaS website.</p>
        </div>
        <div className="flex flex-row gap-3">
          <img src={XLogo} alt="X" width={30} height={30} />
          <img src={InstaLogo} alt="Instagram" width={30} height={30} />
          <img src={PintrestLogo} alt="Pinterest" width={30} height={30} />
          <img src={LinkedinLogo} alt="LinkedIn" width={30} height={30} />
          <img src={TiktokLogo} alt="TikTok" width={30} height={30} />
          <img src={YoutubeLogo} alt="YouTube" width={30} height={30} />
        </div>
      </div>

      {/* Right section */}
      <div>
        vnvwrv
      </div>
    </footer>
  );
};

export default Footer;
